Info - 2012-07-19 23:51:46 --> Array
(
    [app_id] => com.weeswijs.ovchip
    [title] => OV-Chip Checker
    [author] => Reinier Goltstein
    [icon] => https://lh5.ggpht.com/tGZL0RTEcPxQTO5zkgS08SuObdfceuQUDG_e_rAMODIUn7QOM6vLjB6kMZSrzoKkwg=w124
    [description] => ***** Let op: er is op dit moment (6 t/m 13 juli) een probleem met het beveiligings-certificaat van ov-chipkaart.nl, waardoor OV-Chip Checker niet werkt. De applicatie zou weer moeten werken zodra het beveiligingscertificaat weer in orde is. Lees hieronder hoe u kunt helpen dit te bespoedigen.
Wilt u helpen? Probeer dan vanaf uw Android-telefoon in te loggen op ov-chipkaart.nl. Krijgt u een foutmelding dat het beveiligingscertificaat ongeldig is? Neem dan contact op met de ov-chipkaart.nl klantenservice en meld dit.


*** Problemen? Zie FAQ hieronder, of e-mail: <a href="mailto:support@cappital.net">support@cappital.net</a> ***<br>*** Let op: gegevens zijn minimaal 1 dag oud omdat ze van ov-chipkaart.nl komen ***


Met OV-Chip Checker kun je het saldo en de reisgegevens van je ov-chipkaart inzien op je Android device. OV-Chip Checker een aantal onmisbare features:


Gratis versie:<br>- Ondersteuning voor meerdere ov-chipkaart.nl-accounts<br>- De 25 dichtstbijzijnde oplaad-/verkooppunten<br>- Auto-update


Plus-versie:<br>- Langere reisgeschiedenis (zie onder)<br>- Notificatie wanneer je bent vergeten uit te checken<br>- Notificatie wanneer je saldo laag is<br>- Notificatie wanneer je saldo automatisch is opgeladen<br>- Een saldo-widget<br>- Back-up en herstel gegevens naar/van SD-kaart


N.B.: de reisgeschiedenis wordt opgebouwd vanaf het moment dat je OV-Chip Checker geïnstalleerd hebt. Reisgegevens van vóór deze periode kun je niet opvragen via deze applicatie.


Voor meer info over de Plus-versie, kijk op https://market.android.com/details?id=com.weeswijs.ovplus!


Voor vragen en ondersteuning: <a href="mailto:support@cappital.net">support@cappital.net</a>


Instructies:<br>Om gebruik te kunnen maken van OV-Chip Checker moet je je OV-chipkaart gekoppeld hebben aan een account op ov-chipkaart.nl! Volg deze stappen:<br>1 - Maak een account aan op OV-chipkaart.nl en voer je kaartgegevens in.<br>2 - Activeer het transactieoverzicht (<a href="http://www.google.com/url?q=https://www.ov-chipkaart.nl/mijnov/reizenentransacties/mijnreizenentransacties/toonreizenentransacties/)&amp;usg=AFQjCNH4OuaPRU8_3-TPVIaCAQre0rsnzQ" target="_blank">https://www.ov-chipkaart.nl/mijnov/reizenentransacties/mijnreizenentransacties/toonreizenentransacties/)</a>.<br>3 - Een dag na het activeren van je transactieoverzicht kun je het saldo en de transacties van je ov-chipkaart inzien.<br>4 - Vul je login-gegevens in bij de app (onder de menu-knop, 'Account Settings').<br>5 - Vanaf dit moment kun je OV-Chip Checker gebruiken!


FAQ:<br>1. Meerdere kaarten kun je toevoegen door per kaart 1 account te gebruiken.<br>2. Wil je een andere kaart zien, maar op dezelfde account? Stel deze dan in als je voorkeurskaart op ov-chipkaart.nl, optie Kaartbeheer.<br>3. Werkt de app niet? Zorg ervoor dat je saldo zichtbaar is bij het transactie-overzicht op ov-chipkaart.nl.<br>4. Toegang tot locatiegegevens wordt gevraagd om de 25 dichtstbijzijnde oplaadpunten te kunnen opvragen.<br>5. Vodafone, Ice Cream Sandwich en problemen met verbinding over 3G? Leeg je proxy-instellingen!<br>6. Voor andere problemen, vragen, of feature-requests kun je een berichtje sturen naar <a href="mailto:support@cappital.net">support@cappital.net</a> of twitter @mrgoltstein.


OV-Chip Checker stuurt geen gegevens van je OV-Chipkaart door naar de ontwikkelaar; alle data blijft op je telefoon staan. Je wachtwoord wordt versleuteld opgeslagen en ook de verbinding met ov-chipkaart.nl is beveiligd. Wel worden er geanonimiseerde foutmeldingen doorgestuurd; hierbij wordt &gt;geen&lt; persoonlijke data verzonden!


    [release_date] => 2012/07/13
    [rate] => 3.6
    [category] => 交通
    [price] => 0
)

