    [author] => The WOD Shop
    [icon] => https://lh6.ggpht.com/6hB82str34opdnC-FE_gpYrSH-mB_Yprzv2wsWMCkZwy_a3F_voOHeWC4jGDKVaK7w=w124
    [description] => Put your fitness to the test.
The WOD Shop is an application that allows "CrossFitters" to get their workout of the day. 


There are no workout lists to pick and choose from. WODs are generated from a database of 4000+ workouts without the user knowing the exact nature of the task.


WODs are generated from the following categories:


* Weightlifting - Powerlifting and Olympic weightlifting workouts<br>* Endurance - Swimming, biking, running, or indoor rowing<br>* Bodyweight - Workouts involving bodyweight exercises only<br>* Kettlebells - Kettlebell workouts with or without bodyweight exercises<br>* Singlets - Single element workouts; weightlifting (W), endurance(M), or bodyweight (B)<br>* Couplets - Two element workouts; WM, BM, WW, WB, etc.<br>* Triplets - Three element workouts - BWM, WBM, WWB, BBB, etc.<br>* Hybrids - Mixed-modal workouts, four or more exercises performed for multiple rounds<br>* Chippers - Multiple exercises in single round format<br>* The Hopper - All workouts<br>* AMRAP - Work-priority WODs, "As many rounds as possible"<br>* Hero - WODs named in honor of fallen Mil/LEO<br>* Girls - CFHQ's original named benchmark WODs


For example, choosing a "triplet" could result in a WOD that looks like this:


3 rounds<br>10x Clean &amp; jerk (135#/95#) <br>15x Burpees <br>Row 500m


There's your workout.


Loads will be rx'd for most WODs that involve weightlifting (i.e., 135# for guys, 95# for girls in this example). If you cannot perform your WOD then scale back the reps and/or loads, modify or substitute an exercise, or click to get another workout.


Click on the star to "favourite" your WOD. Favourites are available even when you have no data access.


The WOD Shop is not affiliated with CrossFit Inc.


    [release_date] => 2012/05/15
    [rate] => 2.1
    [category] => 健康＆フィットネス
    [price] => 99
)

