(
    [app_id] => nl.qookqook.hoogvliet.app
    [title] => Hoogvliet
    [author] => Logicapps.nl
    [icon] => https://lh3.ggpht.com/lDzDpBrYi3rLMiaccfERoqWvJsA9v9IpuErRUqAO_l9BrE9HVKs8Cr2ppEmKqigMolQ=w124
    [description] => De Hoogvliet app helpt je bij de vraag "wat eten wij vandaag"?
Wekelijks krijg je van Hoogvliet de actuele aanbiedingen te zien. Je kunt recepten kiezen met producten die in de aanbieding zijn door direct vanuit de aanbieding te zoeken op lekkere recepten. Dat is koken met aanbiedingen! De recepten zijn voornamelijk gericht op de hoofdmaaltijd en zijn gemakkelijk te kiezen en te koken.


Je kunt zoeken op type recepten of recepten met bepaalde ingrediënten. Alle benodigde ingrediënten kun je snel op een boodschappenlijstje zetten. De Hoogvliet app berekent de juiste hoeveelheden voor het aantal eters dat je voor die maaltijd bedacht hebt. Zo koop of maak je nooit te veel. 


Met de agenda kun je de recepten plannen. Een gepland recept is heel snel terug te vinden. Als je gaat koken laat de Hoogvliet app een korte en duidelijke bereidingswijze zien. De recepten kun je zelf waarderen met een aantal sterren. Zo staan de recepten die jij lekker vindt altijd bovenaan. Vind je een ingrediënt niet lekker, zet het dan in het "ik wil niet eten lijstje". Hierdoor krijg je nooit meer recepten met dit ingrediënt voorgesteld. 


Aan het boodschappenlijstje kun je allerlei artikelen toevoegen en zelfs overige artikelen of niet-te-vergeten-boodschappen zoals, 'naar stomerij'. Ook kun je een standaard lijstje maken met alle wekelijkse boodschappen en deze integreren met je boodschappenlijstje. De Hoogvliet app  herkent jouw artikelen snel, dus een lijstje is zo gemaakt.


Je kunt ook de barcode van een artikel scannen om het aan je boodschappenlijstje toe te voegen. Als je boodschappenlijstje klaar is, zet de Hoogvliet app  het automatisch in de juiste volgorde voor de afdelingen in de Hoogvliet supermarkt. In de winkel vink je makkelijk af wat je in je wagentje gedaan hebt.


Bij elk recept is een "wijntip" toegevoegd. Zo drink je altijd, de goede wijn bij het goede recept. Ook kun je bij de wijnen die in de aanbieding zijn de juiste recepten zoeken.


Je kunt het boodschappenlijstje ook  e-mailen naar iemand die voor jou de boodschappen gaat doen. Tevens kun je een recept e-mailen, twitteren of op facebook zetten. Vind je het moeilijk om een recept te kiezen? Laat je dan met een recept verrassen door je telefoon kort heen en weer te schudden. De app geeft ook een paar handige kooktips om het koken makkelijker te maken.


De Hoogvliet winkels met de openingstijden zijn gemakkelijk te vinden. Je kunt zoeken naar de dichtstbijzijnde winkels via je GPS locatie of via het intypen van de eerste vier cijfers van je postcode.


Vind jij dat de Hoogvliet app  verder verbeterd kan worden? Laat het ons weten via <a href="mailto:info@logicapps.nl">info@logicapps.nl</a>


    [release_date] => 2012/07/11
    [rate] => 3.4
    [category] => ショッピング
    [price] => 0
)

