    [description] => De grootste taxicentrale van Nederland (Taxicentrale Amsterdam/TCA) heeft een UNIEKE en GRATIS<br>Taxi applicatie beschikbaar gemaakt om SNEL en GEMAKKELIJK een taxi te bestellen.<br>Met deze applicatie kunt u direct in Amsterdam en 24/7 een taxi bestellen. U bereikt met de app niet alleen<br>1250 taxi’s in Amsterdam en omstreken, maar ruim 40.000 taxi’s over heel EUROPA.<br><br>Andere steden in Europa waar u met deze applicatie taxi’s kan bestellen zijn:<br>- Berlijn;<br>- Wenen;<br>- Praag;<br>- Lyon;<br>- Antwerpen;<br>- Rotterdam;<br>- Frankfurt;<br>- München;<br>- Dusseldorf;<br>‐ Hamburg;<br>-  Zurich<br><br>************<br><br>FUNCTIES:<br>* Met de TCA Taxi applicatie heeft u binnen enkele klikken direct een taxi besteld.<br>* U ziet de taxi middels GPRS echt op een kaart naar u toe rijden.<br>* U heeft gelijk inzicht in de kosten en tarieven. U weet dus direct hoeveel de taxirit gaat kosten.<br>* U ziet de tijd dat de taxi bij u is.<br>* U kunt de rit beoordelen en daardoor helpt u de taxichauffeur en TCA om de service nog beter te<br>maken.<br>* U kunt een taxi reserveren door het eenvoudig invoeren van een speciale datum en tijd.<br>* Mogelijkheid om zelf de taal van de applicatie in te stellen (Duits, Frans, Deens, Engels, Tsjechisch);<br>* U kunt de applicatie ook personaliseren naar kleur.<br>* De Taxi applicatie past zich automatisch aan de locatie van de gebruiker aan.<br><br>************<br><br>Snel en makkelijk! Overzichtelijk met een duidelijke prijsopgave en altijd gegarandeerd van een veilige<br>en betrouwbare TCA taxi. 24 uur per dag, 7 dagen per week.<br><br>************<br>HOE WERK HET?<br>Heel simpel. U start de applicatie op en deze herkent automatisch uw locatie. De applicatie helpt u<br>zeer gemakkelijk om snel een taxi te bestellen:<br>* Vliegveld, treinstation, bushalte<br>* Brug zonder adres, waarna u verzocht wordt om naar het dichtst bijzijnde adres te gaan waar de taxi u zal ophalen.<br>* Regio’s waar u alleen met een telefoon een taxi kan bestellen<br>U voert uw naam en eindbestemming (indien nodig) in en de applicatie zoekt direct de dichtstbijzijnde taxi. U krijgt<br>direct melding van de tijd dat de taxi bij u is en u kunt tevens uw eigen taxi volgen op een<br>kaart via GPRS.<br>Tijdens de rit kunt u de taxirit beoordelen en daarmee helpt u direct de taxichauffeur en TCA om kwaliteit en service hoog te houden. Uw feedback is dus meer dan welkom!<br><br>************<br>TCA voor een herkenbare, betrouwbare en veilige taxi!
