    [icon] => https://lh4.ggpht.com/66nkznUOjXAt0QHS8h1W5UuIJWz4vtXzcbr0Qqvkgbxz44ywioZI3gn_UF_f8uKlyzeu=w124
    [description] => Docs Diet Diary is the best. Keep track of your diet and your symptoms together.
The absolute best diet diary on the Android Market. Take charge of your own health by tracking the foods you eat every day along with your health symptoms. This app records date and time of each meal, breakfast, lunch, dinner, snack, and drink, and most importantly, your symptoms. Take the information to your doctor, to monitor your diet and check which foods to which you are sensitive or allergic. Then, email the report to your health professional. 


Tutorial:<br>From the Home screen, tap one of the chosen events you wish to enter information such as Breakfast and the entry screen for Breakfast appears. From there, enter the foods you had for breakfast by tapping in the blank window which opens the keyboard. Once you have entered the foods for breakfast, click set to change date and/or time when you ate breakfast. Then, click save. When clicking save, this takes you immediately to the Diary screen.


Repeat the above for Lunch, Dinner, Snack, Drink, and Symptom. You may enter multiple entries for Snack, Drink, and Symptom with different times for each.


From the Diary Screen, you can swipe horizontally to change days and view previously entered information. Or, tap the gold date bar to change the date to a specific day you want to view. You may also scroll entered information by swiping vertically up to see later information or down to see earlier information.


Now, send the report to your health professional. You can now email the report directly from the Diary screen. Tap Menu, then Preferences to enter email address you want your diary delivered. Then, tap Menu, tap Send Report, then select the account you want the report sent from. Then tap the letter icon at the top to the send the report. You can optionally enter a message for the email. Simple!


